      // HOST_REGEXP taken from Foreman code HOST_REGEXP in file /lib/net/validations.rb
      // But replaced /A with ^ and /z with $
      var hostnameRegex = new RegExp(/^(([a-z0-9]|[a-z0-9][a-z0-9\-]*[a-z0-9])\.)*([a-z0-9]|[a-z0-9][a-z0-9\-]*[a-z0-9])$/);
